import React from 'react'
import useFormik from 'formik'
const Createuser = (props) => {
  const formik=useFormik({
    initialValues:{
      mothername:"",
      fathername:"",
      location:"",
      designation:"",
      city:"",
      age:""
    }
  })

  return (
    <h1>
        {props.formik.values}
    </h1>
  )
}

export default Createuser
